<?php

namespace App\Tests\Utils\Helper;

use App\Utils\Helper\Base64;
use PHPUnit\Framework\TestCase;

class Base64Test extends TestCase
{
    /** @return string[][] */
    public function getData(): array
    {
        return [
            [
                'https://mgorski.dev/build/img/mgorski.png',
                'data:image/png;base64,',
            ],
        ];
    }

    /** @dataProvider getData */
    public function testConvertFromImage(string $input, string $expected): void
    {
        $base64 = new Base64();

        $this->assertSame($base64->convertFromImage($input), $expected);
    }
}
